import React from 'react';
import {AppBar, Toolbar, Button, ThemeProvider, IconButton} from '@material-ui/core';
import HomeIcon from '@material-ui/icons/Home';
import { createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
  palette: {
    primary: {
      // light: will be calculated from palette.primary.main,
      main: '#000000',
      // dark: will be calculated from palette.primary.main,
      // contrastText: will be calculated to contrast with palette.primary.main
    },
  },
});

class Navbar extends React.Component {
  render() {
    return(
      <div>
        <ThemeProvider theme={theme}>
          <AppBar>
            <Toolbar>
              <IconButton aria-label="home" href="/">
                <HomeIcon />
              </IconButton>
              <Button href="/about">About Me</Button>
              <Button href="https://www.linkedin.com/in/leoxia96/" target="_blank">LinkedIn</Button>
              <Button href="https://medium.com/@c3pleo" target="_blank">Blog</Button>
            </Toolbar>
          </AppBar>
        </ThemeProvider>
      </div>
    )
  }
}

export default Navbar
